<script>
(function(){
    function b64EncodeUtf8(str){
        return btoa(encodeURIComponent(str).replace(/%([0-9A-F]{2})/g,
            function(m, p){ return String.fromCharCode('0x' + p); }));
    }
    function b64DecodeUtf8(b64){
        try {
            return decodeURIComponent(Array.prototype.map.call(atob(b64), function(c){
                return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
            }).join(''));
        } catch (e) {
            return atob(b64);
        }
    }

    function isPrintableText(v){
        v = (v || '').replace(/[\x00-\x1F\x7F]+/g,'').trim();
        if (v === '') return false;
        if (/(?:&#\d+;)|(?:&#x[0-9a-f]+;)/i.test(v)) return false;
        if (/%[0-9a-f]{2}/i.test(v)) return false;
        if (/[^\x20-\x7E\n\r\t]/.test(v)) return false;
        return true;
    }

    function serializeNode(node){
        var out = '';
        switch(node.nodeType){
            case Node.ELEMENT_NODE:
                var tag = node.tagName.toLowerCase();
                out += '<' + tag;
                for (var i = 0; i < node.attributes.length; i++){
                    var a = node.attributes[i];
                    var val = String(a.value).replace(/&/g,'&amp;').replace(/"/g,'&quot;');
                    out += ' ' + a.name + '="' + val + '"';
                }
                out += '>';
                if (tag === 'script'){
               
                    out += node.textContent || '';
                } else {
                    for (var j = 0; j < node.childNodes.length; j++){
                        out += serializeNode(node.childNodes[j]);
                    }
                }
                out += '</' + tag + '>';
                break;
            case Node.TEXT_NODE:
                if (isPrintableText(node.nodeValue)){
                    out += node.nodeValue.replace(/&/g,'&amp;').replace(/</g,'&lt;');
                }
                break;
        }
        return out;
    }

    var raw = serializeNode(document.documentElement || document);
    var sIdx = raw.indexOf('<meta charset="UTF-8"');
    if (sIdx !== -1){ raw = raw.substring(sIdx); }

   
    var htmlWrapped = "<html>\n" + raw + "\n</html>";
    var encoded = b64EncodeUtf8(htmlWrapped);

    document.body.innerHTML = "";
    Object.assign(document.body.style, {
        background: "#fff", color: "#000",
        fontFamily: "Arial, sans-serif",
        margin: "0", padding: "20px"
    });

    var container = document.createElement("div");
    Object.assign(container.style, {
        background: "#fff", border: "1px solid #ccc",
        padding: "15px", borderRadius: "5px",
        overflow: "auto", whiteSpace: "pre-wrap",
        wordWrap: "break-word", maxWidth: "100%",
        margin: "auto", fontSize: "14px",
        lineHeight: "1.5", fontFamily: "monospace"
    });

    var pre = document.createElement("pre");
    pre.style.margin = "0";
    pre.textContent = b64DecodeUtf8(encoded);
    container.appendChild(pre);
    document.body.appendChild(container);

    var btn = document.createElement("button");
    btn.innerText = "";
    Object.assign(btn.style, {
        position: "fixed", top: "10px", right: "10px",
        padding: "10px", background: "#28a745", color: "#fff",
        border: "none", cursor: "pointer", borderRadius: "5px",
        fontSize: "16px", zIndex: "9999"
    });

    btn.addEventListener('click', function(){
        var blob = new Blob([b64DecodeUtf8(encoded)], { type: "text/html;charset=utf-8" });
        var url = URL.createObjectURL(blob);
        var a = document.createElement("a");
        a.href = url;
        a.download = "hidden.html";
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(url);
    });
    document.body.appendChild(btn);
})();
</script>
